import React from 'react';
import './App.css';

function WordCounter({text}){
    const wordCounter = text.split(/\s+/).filter((word) => word !== '').length;

    return(
        <div className='cnt'>
            <p>Word Count: {wordCounter}</p>
        </div>
    )
}
export default WordCounter;
